/* eslint-disable */
import React, { Component, useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Headevent from "./components/Headevent";

function App() {

  let [글제목, 글제목변경] = useState(['남자 코트 추천', '강남 우동 맛집', '파이썬 독학']); 
  let [따봉, 따봉변경] = useState(0);
  let posts = '강남 고기 맛집';

  function 제목바꾸기(){
    var newArray = [...글제목];
    newArray[0] = '여자코트 추천';
    글제목변경( newArray );
  }

  return (
    <div className="App">
      <div className="green-nav">
        <Headevent />
        
      </div>

      <div className="red-nav">
          
        <div><ul>
          <li class="ms-level0 nav-1" id="nav-1">
            <a class="ms-label anchor_text" href="/">
               Home 
              </a>
          </li>
        </ul></div>
        <div><ul><button onClick="/"><section>a</section></button></ul></div>
        <div><ul><button onClick="/"><section>b</section></button></ul></div>
        <div><ul><button onClick="/"><section>c</section></button></ul></div>
        <div><ul><button onClick="/"><section>d</section></button></ul></div>
        <div><ul><button onClick="/"><section>e</section></button></ul></div>
        <div><ul><button onClick="/"><section>f</section></button></ul></div>
        
      </div>
      
      <div className="list">
        <h3> { 글제목[0] } <span onClick={ ()=>{ 따봉변경(따봉 + 1) } }>👍</span> {따봉} </h3>
        <p>2월 19일</p>
        <hr/>
      </div>
      <div className="list">
        <h3> { 글제목[1] } </h3>
        <p>2월 19일</p>
        <hr/>
      </div>
      <div className="list">
        <h3> { 글제목[2] } </h3>
        <p>2월 19일</p>
        <hr/>
      </div>
      
      <Modal />

      
    </div>
  );
}

function Modal(){
  return (
    <div className="modal">
        <h2>제목</h2>
        <p>날짜</p>
        <p>상세내용</p>
    </div>
  )
}


export default App;
